import React, { useState, useEffect } from 'react';
import Layouts from '../../Layouts/Layouts';
import axios from 'axios';

function Projectdata() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/projects/allProjects');
        if (response) {
          setData(response.data);
        }
      } catch (error) {
        console.log("Error while fetching data");
      }
    };
    getData();
  }, []);

  return (
    <Layouts>
      <div className="container mx-auto px-4 mt-8">
        <table className="min-w-full bg-white border border-gray-300">
          <thead>
            <tr>
              <th className="py-2 px-4 border-b text-left">SN</th>
              <th className="py-2 px-4 border-b">ProjectID</th>
              <th className="py-2 px-4 border-b">GuideID</th>
              <th className="py-2 px-4 border-b">GuideName</th>
              <th className="py-2 px-4 border-b">ReviewerID</th>
              <th className="py-2 px-4 border-b">ReviewerName</th>
              <th className="py-2 px-4 border-b">Action</th>
            </tr>
          </thead>
          <tbody>
            {data.guide && data.guide.map((project, index) => (
              <tr key={index}>
                <td className="py-2 px-4 border-b">{index + 1}</td>
                <td className="py-2 px-4 border-b">{project.ProjectID}</td>
                <td className="py-2 px-4 border-b">{project.GuideID}</td>
                <td className="py-2 px-4 border-b">{project.Name}</td>
                <td className="py-2 px-4 border-b">{project.ReviewerID}</td>
                <td className="py-2 px-4 border-b">{project.Name}</td>
                <td className="py-2 px-4 border-b">
                  {/* Add action button or link as needed */}
                </td>
              </tr>
            ))}

            {data.reveiwer && data.reveiwer.map((project, index) => (
              <tr key={index}>
                <td className="py-2 px-4 border-b">{index + 1}</td>
                <td className="py-2 px-4 border-b">{project.ProjectID}</td>
                <td className="py-2 px-4 border-b">{project.GuideID}</td>
                <td className="py-2 px-4 border-b">{project.Name}</td>
                <td className="py-2 px-4 border-b">{project.ReviewerID}</td>
                <td className="py-2 px-4 border-b">{project.Name}</td>
                <td className="py-2 px-4 border-b">
                  {/* Add action button or link as needed */}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </Layouts>
  );
}

export default Projectdata;
